import { Typography, Button } from "@mui/material";
import { Link, useNavigate } from "react-router-dom";
import "../styles/Landingpage.css";

const Landingpage = () => {

    let navigate = useNavigate();

    return (
        <>
            <Typography variant="h2" sx={{ textAlign: 'center', marginTop: '50%', marginBottom: '50%' }}>
                Ge & Ta
            </Typography>
            <Button sx={{
                backgroundColor: '#F3A358',
                margin: 'auto',
                width: '90%',
                height: '2.5rem',
                fontWeight: 'bold',
                color: 'white',
                fontSize: '1rem',
                left: '50%',
                marginLeft: '-45%',
                position: 'absolute',
                bottom: 0,
            }}
                onClick={() => { navigate('/Confirm') }}>
                Logga in
            </Button>
        </>
    );
}

export default Landingpage;
